import React from 'react';

class Customer extends React.Component {
    constructor(props) {
        super(props);
    }
    render() {
        const data = this.props.data;
        return (
            <div>
                <p> { data.business_name }</p>
                <p>{data.business_name}</p>
            </div>
        );
}
}

export default Customer;
